import Head from 'next/head'
import Layouts from '../Components/Layouts/Layouts'
import {StaticRouter as BrowserRouter } from 'react-router'

const Index = () => {
    <div>
    <style jsx global>{`
      body {
        margin: 0px;
        padding: 0px;
        font-family: 'Montserat',sans-serif;
        background-color:green;
        padding:4em;
      }
    `}</style>
  </div>
    
    return (
        
        <>
        <Head>
          <title>
            React
          </title>
          <link rel="stylesheet" src={style}/>
        </Head>
        <BrowserRouter>

        <Layouts>        
            <h1>This is the Home application</h1>
        </Layouts>
        </BrowserRouter>
        </>
    )
}

export default Index
